import logo from "./logo.svg";
import "./App.css";
import Header from "./Components/WrapperComponets/Header/Header";
import Sidebar from "./Components/WrapperComponets/Sidebar/Sidebar";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./Components/ContentComponents/Home/Home";
import Music from "./Components/ContentComponents/Music/Music";
import Genres from "./Components/ContentComponents/Genres/Genres";
import Station from "./Components/ContentComponents/Station/Station";
import Artists from "./Components/ContentComponents/Artists/Artists";
import Content from "./Components/WrapperComponets/Content/Content";

function App() {
  return (
    <Router>
      <Header />
      <Sidebar />
      <Content />
      <Switch>
        <Route exact path="/home" component={Home} />
        <Route path="/music" component={Music} />
        <Route path="/genres" component={Genres} />
        <Route path="/station" component={Station} />
        <Route path="/artists" component={Artists} />
      </Switch>
    </Router>
  );
}

export default App;
